import React from "react"
import { Dropdown, DropdownButton } from 'react-bootstrap'
import { products } from './Home';
import "./../styles.css";

function DropdownMenu () {
    return (
        <DropdownButton style={navdDropdown} alignRight id="nav-dropdown" title="All">
            {products.map(product => (
                <Dropdown.Item className='actve' href="#/action-1">{product}</Dropdown.Item>
            ))}
        </DropdownButton>
    );
}

 const navDropdown = () => {
    color: "white";
    fontWeight: bold;
    border: none;
    backgroundColor: "#FF3347";
  }

export default DropdownMenu;
